// import { Link } from 'react-router-dom';

const Medical_center = ({ medical }) => {


    return (



        <div className="perintcared">
            {medical.map((medicals) => (
                <div class="card" key={medicals.id}>
                    <img src={medicals.imge} class="card-img-top" alt="" />

                    <div class="card-body">
                        <h5 class="card-title">Medical Name:<h7>{medicals.title}</h7></h5>
                        <h5 class="card-title">Medical Location:{medicals.Location}</h5>
                        <h5 class="card-title">Medical Working hours:{medicals.Workinghours}</h5>

                        {/* <Link to={`/Details/${jack.id}`} className="btn btn-primary">Details</Link> */}
                    </div>
                </div>
            ))}
        </div>

    );

}
export default Medical_center;
